const Navbar = (props) => {

  const style = {
    background: "rgba(0,0,0,0.1)",
    height: "80px"
  }
  
  return (
    <nav className="nav-wrapper" style={style}>
      <div className="container">
        <a className="brand-logo">kanban</a>
        <ul className="right">
        </ul>
      </div>
    </nav>
  )
}

export default Navbar;
